import { createSlice } from '@reduxjs/toolkit';

const initialState = {
  currentOperand: 1,
  previousOperand: 1,
  operation: 3,
};

export const calculateSlice = createSlice({
  name: 'calculate',
  initialState,
  reducers: {},
});

export default calculateSlice.reducer;
